International Boxing Hall of Fame (IBHOF) - Międzynarodowa Bokserska Galeria Sławy znajduje się obecnie w mieście Canastota w stanie Nowy Jork i jest jedną z dwóch uznawanych bokserskich galerii sławy obok World Boxing Hall of Fame. Pierwsza Boxing Hall of Fame została stworzona przez The Ring i znajdowała się w Madison Square Garden, jednakże w 1990 roku z inicjatywy Eda Brophy by uczcić dwóch mistrzów bokserskich Carmena Basilio oraz jego bratanka Billy'ego Backusa, którzy pochodzą właśnie z miasteczka Canastota, jego władze otwarły nowe muzeum, które pokazuje bogatą historię boksu. W ceremoniach odbywających się każdego roku bierze udział bardzo wiele byłych jak i obecnych wielkich pięściarzy oraz wielu innych słynnych ludzi z różnych branż. Nominacja boksera do Hall of Fame może odbyć się dopiero po upływie pięciu lat po zakończeniu kariery sportowej. Do 2014 wybierano członków Międzynarodowej Bokserskiej Galerii Sławy w pięciu kategoriach: 
*  Współcześni (Modern) – ostatnia walka nie wcześniej niż w 1943 roku; 
*  Dawni mistrzowie (Old Timers) – ostatnia walka nie wcześniej niż w 1893 roku i nie później niż w 1942 roku; 
*  Pionierzy (Pioneers) – ostatnia walka w lub przed 1892 rokiem; 
*  Obserwatorzy (Observers) – dziennikarze, historycy, pisarze i artyści; 
*  Inni (Non-participants) – osoby, które przyczyniły się do rozwoju boksu w sposób inny, niż bokserzy i obserwatorzy. Począwszy od 2015 wprowadzono następujące zmiany: 
*  Kategoria „Współcześni” obejmuje bokserów, których walka odbyła się nie wcześniej niż w 1989 roku; 
*  Kategoria „Dawni mistrzowie” obejmuje bokserów, których walka odbyła się nie wcześniej niż w 1893 roku i nie później niż w 1988 roku i została podzielona na dwie podkategorie: „Wcześni” (Early, ostatnia walka nie później niż w 1942 roku) i „Późni” (Late, ostatnia walka nie wcześniej niż w 1943 roku); wybory będą odbywać się co roku przemiennie dla każdej podkategorii, zaczynając od „późnych” mistrzów w 2015; 
*  Wybory do kategorii „Pionierów” będą odbywały się co 5 lat, przy czym pierwsze będą miały miejsce w 2019.
